import ListeAnnonce from '../components/contenue_Annoce/FrameCategorie';

const Annonce = () => {
    const token = sessionStorage.getItem('token');
    useEffect(() => {
        /*if (!token) {
            window.location.href = '/login';
        }*/
    }, [token]);
    return (
        <>
            <div class="wrapper">
                <Header />
                <Sidebar />
                <div className="content-wrapper" >
                    <ContentHeader text="Liste des annonces"/>
                    <ListeAnnonce />
                </div>
                <Footer />
            </div>

        </>
    );
};

export default Annonce;
